import{_ as a,o as i,c as g,a0 as c}from"./chunks/framework.CSGB4SNl.js";const b=JSON.parse('{"title":"下载jenkins","description":"","frontmatter":{},"headers":[],"relativePath":"java/devops/jekins.md","filePath":"java/devops/jekins.md"}'),t={name:"java/devops/jekins.md"};function e(s,A,l,d,p,m){return i(),g("div",null,[...A[0]||(A[0]=[c('<h1 id="下载jenkins" tabindex="-1">下载jenkins <a class="header-anchor" href="#下载jenkins" aria-label="Permalink to &quot;下载jenkins&quot;">​</a></h1><p>这里我是把jenkins下载到windows本机运行，如果像部署到服务器上，无非也就是拉取其docker镜像，然后开放端口，进入界面进行操作</p><p>直接去官网下载-地址：<a href="https://www.jenkins.io/" target="_blank" rel="noreferrer">Jenkins</a></p><p><img src="https://i-blog.csdnimg.cn/direct/0a0651d34f49493e8fc7854f4de7fee7.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/a6fb1f6a66cd4f04bd06384f7ec8f994.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>通常选择左侧长期稳定版本</p><p><img src="https://i-blog.csdnimg.cn/direct/693e164098c7483288041747fa6aa428.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>这边选择对应的系统下载即可</p><p><img src="https://i-blog.csdnimg.cn/direct/e9b4c79c48c1480f81e25436f3c64496.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>之后正常安装即可</p><p><img src="https://i-blog.csdnimg.cn/direct/33fe902fd8fb4039832a9c318ce88881.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>通常选择上面那个就行</p><p><img src="https://i-blog.csdnimg.cn/direct/53da585ca4304acea2c4f43841958ef3.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>一定要记住配置的端口，之后就靠它打开了</p><p><img src="https://i-blog.csdnimg.cn/direct/dc6365bcdd4d43a5acf087e4b5d9ed0a.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>选择对应的jdk版本，目前最低都要17</p><p>接下来一直next就行了</p><h1 id="配置jenkins" tabindex="-1">配置jenkins <a class="header-anchor" href="#配置jenkins" aria-label="Permalink to &quot;配置jenkins&quot;">​</a></h1><p>输入localhost:你配置的端口-就能进入到这样的界面</p><p><img src="https://i-blog.csdnimg.cn/direct/323dff29be18470db820c8588811125c.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>然后进入到对应的地址拿到密码就行</p><p><img src="https://i-blog.csdnimg.cn/direct/8a63c60f39d54600b790cac76905c5ef.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>选择安装推荐的插件，这里即使有安装不成功的也能在之后去手动安装</p><p><img src="https://i-blog.csdnimg.cn/direct/8e53abe6a5b9450cb4e75b968d07b502.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>进入之后长这样</p><p><img src="https://i-blog.csdnimg.cn/direct/ee126da4b54c4cf8a7412a0645f20251.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>此时我们想要通过jenkins来进行springboot项目的部署</p><p>首先要配置jdk和maven</p><p><img src="https://i-blog.csdnimg.cn/direct/22e7e8dbcbbf4cb9bb5c1c96ad9bdb82.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/045c658f2698434a929fa5bf4be26645.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>git默认配置就好</p><p><img src="https://i-blog.csdnimg.cn/direct/5c30e4d317424687af63790e48b385ea.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>maven也是和jdk一样可以手动配路径，也可去网上下载，注意：下载的记得改成国内镜像，不然后续运行会超时等</p><p>配置ssh远程连接</p><p><img src="https://i-blog.csdnimg.cn/direct/8a29937a7bb946749ba1bd5b0a0b22d3.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/a2fb4829a480487abc42e3f2cc25c366.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>如果这里没有ssh，那就去下载ssh连接插件</p><p><img src="https://i-blog.csdnimg.cn/direct/353eb67af0614a49a2f0888dac3bc6e3.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/a25b7f4d1cf94bc0bb376e55412799ed.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/3fdfe75178404902b675a577f6019b36.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/faecaa1dbf2a4d82a8cfb36242c7f7c3.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/034a59fda54e4fa38a26cd4cdd7cc649.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/76a74d7aefd846a48cf80329ded4f757.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><h1 id="配置自动化任务" tabindex="-1">配置自动化任务 <a class="header-anchor" href="#配置自动化任务" aria-label="Permalink to &quot;配置自动化任务&quot;">​</a></h1><p><img src="https://i-blog.csdnimg.cn/direct/23fa1cffb9424e70b94f6ac972c87730.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/f70f2d80648049bbab1a48d43151b883.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/27b55985fa0744d0815af16797fd95ed.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/4b39b93cdeaf4acb85d910bbdf1e6292.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/af4c2dc56959457ca438fad0138feb24.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/8e03edcf9dc348c09763ec849ebe24cd.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/6002d5674f3e4920b02b04fb4cc3fc99.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/dddae0b6f22a49d1b445a1e51167b10d.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/68f5a657b9ba479ea6bed75ea2a0efe6.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>接下来保存即可</p><h1 id="配置sh脚本" tabindex="-1">配置sh脚本 <a class="header-anchor" href="#配置sh脚本" aria-label="Permalink to &quot;配置sh脚本&quot;">​</a></h1><p>在一个指定目录下创建sh脚本</p><p><img src="https://i-blog.csdnimg.cn/direct/9d1511bad7a1464792a360f1e1d3ba1f.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>创建后填入命令-我这边是一个比较简单的部署运行jar包的命令，大家也可自行编写修改-里面路径jar包名称要对应</p><p><img src="https://i-blog.csdnimg.cn/direct/40cdedfeb3f1489b9d9a25a45a0439b0.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><h1 id="运行任务" tabindex="-1">运行任务 <a class="header-anchor" href="#运行任务" aria-label="Permalink to &quot;运行任务&quot;">​</a></h1><p><img src="https://i-blog.csdnimg.cn/direct/b514737ba7ba4d43b21935ca2b61f579.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>运行即可</p><p><img src="https://i-blog.csdnimg.cn/direct/5a61ecc4656e4d09a0f76ecab2b7c43c.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p><img src="https://i-blog.csdnimg.cn/direct/e27dbd0344ef44a4adf8ba3182abdb51.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>然后我们来看下jar包是否真的被上传部署上去了</p><p><img src="https://i-blog.csdnimg.cn/direct/af29b27d18c440ebbf3127a4642246d3.png" alt="img"><img src="data:image/gif;base64,R0lGODlhAQABAPABAP///wAAACH5BAEKAAAALAAAAAABAAEAAAICRAEAOw==" alt="点击并拖拽以移动">编辑</p><p>可以看到确实是有了</p><p>再来看下项目是否运行了</p>',68)])])}const r=a(t,[["render",e]]);export{b as __pageData,r as default};
